import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Pagrindinis_d.css";

const Header = () => {
    const [menuOpen, setMenuOpen] = useState(false);
    const navigate = useNavigate();

    const openMenu = () => {
        setMenuOpen(true); // Atidaro meniu
    };

    return (
        <header className="header">
            <img className="logo" src="/nuotraukos/logo.png" alt="Logo" />
            <div className="hamburger-menu" onClick={openMenu}>
                <span></span>
                <span></span>
                <span></span>
            </div>
            {menuOpen && <Meniu onClose={() => setMenuOpen(false)} />}
        </header>
    );
};

const Meniu = ({ onClose }) => {
    return (
        <div className="meniu-overlay">
            <div className="meniu-content slide-in">
                <button className="close-x" onClick={onClose}>
                    X
                </button>
                <h1>Apie mane</h1>
                <h2>Mano darbai</h2>
                <h3>BENDRADARBIAUJAM?</h3>
            </div>
        </div>
    );
};

export default Header;
